您想查找了解的退休职工大病医保的缴费政策属于洛阳市医疗保障局的业务，不属于我局职能范围，所以您在我局官网未搜索到相应信息。请您与洛阳市医疗保障局（0379-81810120）联系进行咨询。感谢您的理解与支持！"}],"hasMoreItems":false}

